    Question(
        text:
            r'''<p>A paginação de sobra (shadow paging) é uma técnica útil na recuperação após
falhas em sistemas de bancos de dados. Sobre essa técnica, assinale a alternativa INCORRETA.</p>
    <p>A)O uso de logs e checkpoints são dispensáveis no contexto multiusuário com transações
