      <p>B)Quando uma página é atualizada, essa página muda de local no disco, se não ocorrer falha na
execução da transação.</p>
      <p>C)No início de uma transação, o diretório cujas entradas apontam para as páginas de dados mais
recentes no disco (diretório atual) é copiado para um diretório de sombra.</p>
      <p>D)Durante a execução da transação, o diretório de sombra não é modificado.</p>
      <p>E) Na ocorrência de falha, o estado de banco de dados antes da execução da transação está
disponível por meio do diretório de sombra.</p>''',
        correctAnswer: 'A'),
    Question(
        text:
