<p>II. Diagramas de comunicação permitem modelar a troca de mensagens entre objetos, enfatizando
as relações estruturais entre objetos/classes.</p>
<p>III. Um diagrama de componentes tem por objetivo mostrar a estrutura de um sistema em termos
dos componentes de software que devem estar instalados em unidades de processamento (e.g.
