AFND deve ser transformado para um Autômato Finito Determinístico (AFD), utilizando o algoritmo
de subconjuntos. Em relação à ER e à conversão AFND para AFD, considere as assertivas abaixo,
assinalando V, se verdadeiras, ou F, se falsas.</p>
    <p>( ) A ER de origem é “(ab|b+)+a”.</p>
    <p>( ) A ER de origem é “(ab|b*)+a”.</p>
    <p>( ) A ER de origem é “(ab|b*)*a”.</p>
    <p>( ) O AFD resultante tem 4 estados.</p>
    <p>v( ) O AFD resultante tem 5 estados.</p>
    <img src='data:image/png;base64,' />
    <p>A ordem correta de preenchimento dos parênteses, de cima para baixo, é:</p>
    <p>A)V – F – F – F – V.</p>
      <p>B)F – V – F – V – F.</p>
      <p>C)F – V – F – F – V.</p>
      <p>D)F – F – V – F – V.</p>
      <p>E)V – F – V – V – F.</p>''',
        correctAnswer: '*'),
    Question(
        text:
            r'''<p>Quando um processo na máquina A chama um procedimento na máquina B, o
