Informações podem ser transportadas do chamador para quem foi chamado nos parâmetros e
podem voltar no resultado do procedimento. Absolutamente nada da troca de mensagens é visível
para o programador. Esse método é conhecido como:</p>
    <p>A)Chamada de Procedimento Remoto (RPC). </p>
      <p>B)Protocolo Universal de Datagramas (UDP).</p>
      <p>C)Protocolo de Transporte em Tempo Real (RTP).</p>
      <p>D)Middleware Orientado a Mensagem (MOM).</p>
      <p>E)Linguagem de Programação de Interface (IDL)</p>''',
        correctAnswer: 'A'),
    Question(
        text:
            r'''<p>Qual protocolo que converte nome em string ASCII em endereço de rede?</p>
