      <p>C)Dá aos computadores a habilidade de aprender como um agente deve agir em um ambiente.</p>
      <p>D)Dá aos computadores a habilidade de aprender como reduzir erros.</p>
      <p>E)Dá aos computadores a habilidade de aprender sem serem explicitamente programados para a
