compartilhado?</p>
    <p>A)Relógios vetoriais.</p>
      <p>B)Eleição.</p>
      <p>C)Exclusão mútua distribuída.</p>
      <p>D)Relógios lógicos.</p>
      <p>E)Posicionamento global.</p>''',
        correctAnswer: 'C'),
    Question(
        text:
            r'''<p>A fase de análise sintática de um compilador pode ser implementada através de
reconhecedores (parsers) de gramáticas livres de contexto, com estratégias ascendentes (bottomup) ou descendentes (top-down). Considere a gramática com cinco produções abaixo, sendo que
são não terminais os símbolos S e A, sendo o primeiro o símbolo não terminal inicial da gramática,
e, os demais, símbolos terminais:</p>
$$
\begin{array}{l}{\mathrm{S} \rightarrow \mathrm{Aa}} \\ {\mathrm{S} \rightarrow \mathrm{b} \mathrm{c}} \\ {\mathrm{S} \rightarrow \mathrm{bc}} \\ {\mathrm{S} \rightarrow \mathrm{bda}} \\ {\mathrm{A} \rightarrow \mathrm{d}}\end{array}
$$
    <p>Analise as seguintes assertivas:</p>
    <p>I. A gramática é reconhecida por um analisador preditivo LL(1), pois as características da
    gramática não inibem a construção da tabela de reconhecimento.</p>
    <p>II. Esta gramática não é reconhecida por um analisador LR(0), pois existe um conflito do tipo
    empilha-reduz no estado que contém os seguintes itens LR(0) “S -> bd . a”, e “A → d”.</p>
    <p>III. A gramática é reconhecida por uma analisador SLR(1), pois ele resolve o conflito do tipo
    empilha-reduz LR(0).</p>
    <p>IV. A gramática é LR(1).</p>
    <p>Quais estão corretas?</p>
    $$
\begin{array}{l}{\text { A) Apenas I. }} \\ {\text { B) Apenas II. }} \\ {\text { C) Apenas II e III. }} \\ {\text { D) Apenas II e IV. }} \\ {\text { E) I, II, III e IV. }}\end{array}
$$''',
        correctAnswer: 'D'),
    Question(
        text: r'''<p>Árvores de decisão são algoritmos que utilizam:</p>
    <p>A)Estruturas de IF-ELSE para realizar aprendizado.</p>
      <p>B)Estruturas de repetição alinhadas para realizar aprendizado.</p>
      <p>C)Aprendizado estatístico para construção de regras no aprendizado.</p>
      <p>D)Exclusivamente funções matemáticas como estruturas de dados elementares para realizar
aprendizado.</p>
      <p>E)Paradigma de programação em lógica para realizar aprendizado.</p>''',
        correctAnswer: 'C'),
    Question(
        text: r'''<p>Considere as assertivas abaixo sobre teste de sistema:</p>
      <p>* O teste de ______________ tem por objetivo fazer o software falhar de diferentes maneiras, a
      fim de verificar a capacidade de recuperação do software a um estado normal de funcionamento.</p>
      <p>* O teste de ______________ exercita o sistema de forma a observar seu desempenho em
      situações de demanda anormal de recursos, quer em termos de quantidade, frequência ou
      volume.</p>
      <p>* O teste ___________ exercita o software em cada ambiente ou plataforma no qual deve
      funcionar. Também pode incluir examinar os procedimentos de instalação, softwares para a
      instalação (e.g. instaladores), e a documentação usada para apresentar o software ao usuário.</p>
      <p>Assinale a alternativa que preenche, correta e respectivamente, as lacunas das assertivas acima.</p>
      <p>A)recuperação – stress – de implantação</p>
      <p>B)segurança – stress – beta</p>
      <p>C)recuperação – carga – de implantação</p>
      <p>D)segurança – carga – de implantação</p>
      <p>E)recuperação – stress – beta</p>''', correctAnswer: 'A'),
  ],
);

